 To terminate a C program, you typically use the `exit()` function from the `stdlib.h` library. This function takes an integer argument that is returned to the operating system, indicating the reason for the program's termination.

Here is a simple example of how you might use `exit()`:

```c
#include <stdio.h>
#include <stdlib.h>

int main() {
    printf("This is a simple C program.\n");
    exit(0); // Terminates the program with a success status
    return 0; // This line will never be reached
}
```

In this example, the program prints a message and then terminates with a status of 0, which is the standard return value for successful program execution.

If you want to terminate the program with a specific status code, you can pass that code as the argument to `exit()`. For example, if you want to terminate the program with a status code of 1, you would use:

```c
exit(1);
```

This is useful in situations where you want to signal an error or other exceptional condition. The receiving process can check the exit status to determine if the program terminated normally or if there was an error.
